const svgBox3 = [];
const svgBox4 = [];
const svgBox5 = [];


cardCocuk.forEach(element => {
    element.addEventListener('mouseover',cardSvgSelector);
    });

aquariumDom.addEventListener('click',aquarium);

//console.log(bubble);


function cardSvgSelector (event) {   

    let multipler = Math.floor(Math.random() * svgBox.length);
    svg = event.target.querySelector('.card-cocuk-svg')
    svg.innerHTML = svgBox[multipler];
    };

function getSpeed(){
    let speed = Math.floor(Math.random() * 90) + 30;
    return speed;
};

function getSize (){
    let size = Math.floor(Math.random() * 70) + 31;
    return size;
};

function setSize(array) {
    array.forEach(element => {
        element.style.width = `${getSize()}%`;
    });
}

function setSpeed(array) {
    for (let index = 0; index < array.length; index++) {
        speedVal[index] = getSpeed();
        //console.log(speedVal);
        //console.log('---------')        
    }
}

function aquarium () {
    for (let index = 0; index < bubble.length; index++) {
        const element = positionVal[index];
        
        bubble[index].style.display = 'block';
        bubble[index].style.transform = `translateY(-${positionVal[index]}%)`
        
        if (element == undefined) {
            positionVal[index] = 0;
            setSpeed(bubble);
            setSize(bubble);
        };

        
        if (element > 1600) {
            bubble[index].style.transform = `translateY(-${positionVal[index]}%)`
            console.log(element);
            bubble[index].style.display = 'none';
            positionVal[index] = 0;
            bubble[index].style.width = `${getSize()}%`;
            speedVal[index] = getSpeed();
            let rotate = Math.floor(Math.random() * 360) +1;
            let opacity = Math.floor(Math.random()) + 0.7;
            bubble[index].querySelector('svg').style.opacity = `${opacity}`;
            bubble[index].querySelector('svg').style.transform = `rotate(${rotate}deg)`;
        };
        
        positionVal[index] = positionVal[index] + speedVal[index];
        //forun dışına almak gerekiyor olabilir.

        
    };
    

    setTimeout(() => {
        aquarium();
    }, 400);
}